                            {\n                                    \"dataType\": \"string\",\n                                    \"inputControl\": \"textarea\",\n                                    \"label\": \"ANSWER\",\n                                    \"name\": \"ANSWER\",\n                                    \"repeatable\": false,\n                                    \"value\": {\n                                        \"data\": \"اگر آپ کے پاس ہے کہ شاید بس سسٹم اس کی جگہ لے سکے اور اصل پاس کی وضاحت کر سکے تاکہ فائنڈر اسے استعمال نہ کرسکے۔ اس کے علاوہ ، اگر آپ بس چھوڑنے کے فورا. بعد اس نقصان کو پکڑ لیتے ہیں تو ڈرائیور آپ کو تلاش کرسکتا ہے اور اسے روک سکتا ہے۔ بس کے نظام سے رابطہ کریں اور بھیجنے والے سے ڈرائیور سے اس کی تلاش کرنے کو کہیں۔\"\n                                    }\n                                }\n                            ],\n                            \"repeatable\": true,\n                            \"value\": {\n                                \"data\": \"میں نے اپنا بس کارڈ کھو دیا ، میں اس نقصان کی اطلاع کہاں دے سکتا ہوں؟\"\n                            }\n                        }\n                    ],\n                    \"repeatable\": false,\n                    \"value\": {\n                        \"data\": \"اکثر پوچھے گئے سوالات\"\n                    }\n                }\n            ],\n            \"contentStructureId\": 35734,\n            \"creator\": {\n                \"familyName\": \"Test\",\n                \"givenName\": \"Test\",\n                \"id\": 20130,\n                \"name\": \"Test Test\",\n                \"profileURL\": \"/web/test\"\n            },\n            \"dateCreated\": \"2020-05-29T10:35:05Z\",\n            \"dateModified\": \"2021-02-23T10:09:05Z\",\n            \"datePublished\": \"2020-05-29T10:28:00Z\",\n            \"friendlyUrlPath\": \"faq_wcm\",\n            \"id\": 35745,\n            \"key\": \"35743\",\n            \"numberOfComments\": 0,\n            \"renderedContents\":