    static let newsResponseInArabic = "[\n    {\n        \"categoryName\": \"السياحة\",\n        \"bannerImageURL\": \"https://192.168.59.11:8080/documents/35746/61179/2204246-453570186+%282%29.jpg/da70fa60-a56d-7eb6-11c6-950b2c576a91?t=1595834734854\",\n        \"tileImageURL\": \"https://192.168.59.11:8080/documents/35746/61179/2204246-453570186+%283%29.jpg/497b4c63-2e3d-3f25-00e6-b155a74a0b83?t=1595834734885\",\n        \"title\": \"Tourism\",\n        \"description\": \"أعلنت بلدية مكة عن استعداد خطتها التشغيلية لحج هذا العام بما يتماشى مع الإجراءات الاحترازية لحماية الحجاج من التعاقد على COVID-19. قامت البلدية بتوظيف أكثر من 18،490 عامل لتنفيذ خطتها لموسم الحج هذا العام لتقديم أفضل الخدمات للحجاج. يوجد 28 مركز خدمة جديد ومجهز بالكامل منتشرة في جميع أنحاء الأماكن المقدسة بالإضافة إلى ا\",\n        \"publishDate\": \"2020-07-27T07:24:00Z\",\n        \"newsURL\": \"https://192.168.59.11:8080/news-detail?dbufhpsz-72268-je-72287\"\n    },\n    {\n        \"categoryName\": \"تقنية\",\n        \"bannerImageURL\": \"https://192.168.59.11:8080/documents/35746/42878/Image+4.png/e7ce6beb-42a2-6460-ffac-6687e9ad6c89?t=1593409819663\",\n        \"tileImageURL\": \"https://192.168.59.11:8080/documents/35746/42878/c2_2+%281%29.jpg/57695a8f-cdfa-8ec7-451d-7eca22ecc153?t=1593407749342\",\n        \"title\": \"محطة مترو الرياض المستقبلية في حي الملك عبد الله المالي(كافو))\",\n        \"description\": \"في كل مكان يفكر في التناقض أشاطركم شجب ذلك ، توبيخي الأول هو مخاطر الأسباب. \\\"إنه يدعى\\\" أوميتانتور بلاغة أبدية بالكاد كرة القدم ، الحياة ، تختلف معهم القوة إلى. ليس من الصعب اختيار لنا. هذه ضحكاتي لا تتفق معهم من البحر إلى تعليم (إلكترام)بشكل غير مباشر وهذا لا يكاد يذكر للحصول على المثابرة ، بالنسبة لمواطني الاتحاد الأوروبي ، لا مجرد التفكير في أنه يتصور المسرح. إستعملي ما تطلقينه على القرار السريع يتطلب المزيد منه في كل مكان دائما يدعو ذلك لا. إذا كان مرغوبا فيه ، الغضب الأبدي الشهير ليس بالكاد. كراهية الشواء تجدك بالكاد ، لتكون قادرا على الرقص التالية أو ، مع الوقوف إزالة جعل الذي. هل الاتحاد الأوروبي أي قاض أفضل. ليس من أجل تجربة الفندق أيضا ، قل الحكماء وأرفض العنف أيضا. في نهاية المطاف المتذوق القيام بذلك ، هو بجانب لمنصة للمواطنين الحيوانية. أولا ، أقول سؤال الإيبيكورينز ، لذلك أنت عسل غير متحيز عليه. والعسل نظرة على الرجال الكبار يريدون إلى الناس ميزة تفعل ذلك. الحاسوب يزيل ممارسة  ، الحد الأدنى يختلف معهم قوة بالقوة ، الذي مكتب الطب الشرعي مع. المكان  و بلدي ل الآخرين لقراءة في. البحر يستخدم الكشف عن المضطهدين من. مغفرة القرض (هومر) أو أنت تلك التي تطورت حيث آتي للترجمة إلى رب عمل غير راغب في التوسط يجب أن يجد  للاتحاد الأوروبي. هي أو المدعومة يجب أن. وهي تتذوق مجموعة من المرغوب فيها أيضا. أول تحية يونانية لك ، لدي حقيبة خائفة منه ، وليس أداء للطلاق. المورد المناسب للقنصل والحرص على توجيهه ، في طريقتي التمويلية البليغة ، يجب أن يكون مرغوبا فيه عادة. لتحريض شخص ما، وليس لإفساد فخامتي ، أنت أقل من ديلينتي هذه. موقعي الذي صنعته كل الحواس تطلب مني الرفض لنتفق على أن استخدام الشجرة لا يعني أن هذه القيم تدعم العدو. لقد رأى المتهمين يتبعون الاتحاد الأوروبي لكن الضاحكين أنقذوا الجرعة المسلمة ل. ليس العالم معتدل لكن. تلك الحكمة لا ، الشجرة المتهم أو ، حمل أفضل يتفاخر بالحق في الإساءة. من السهل تصويبه في كل مكان تريد أن ترغب في الثناء ديموقراطيس كان على علم ، أنك تريد الناس لمزاح الآخرين. كان عندنا لكن أنت ،  هم إليه. اقرأ \\\"إلكترام\\\" يتباهى بها بدون ألمي في أي طلاق ، كتب الكمبيوتر شائعة ومستقيمة على حد سواء. هو ، وأولئك الذين يستمعون إلى الفلسفة ، والبقية على قدم المساواة أو لا. فيسر بارك أدرك أن التجربة بالنسبة له. وظيفة التفكير في ذلك. حملوا الشر إلى ل. مكتوب أن تظهر على مر السنين تنزلق وحدة الجرائم الخاصة بي و الآن الحركات تسميها لا (بيرتو ريفيديانز ميل) ، الكتاب هو شاب أفضل للا بالنسبة للأداء القليل من ردع المشاكل وطريقة أسباب وجود وحدة المعالجة المركزية. كان يمكن أن يكون السؤال ما إذا كان ، وأعني قليلا. هذه (إيرم فيتوبيراتوريبس ني) ، إنقلبت في أي مكان ، دعابتي الوحيدة هي. لقد سجلوا هذه بشكل غير عادي لقد أنشأت شركة أفلام خاصة به ، بالكاد اختارت ذلك. بالنسبة له المكتب ذلك. له للبيع يأخذ خصمك إليه ، له الكثير من اليونانية أفضل. يجب أن يفهم الاتحاد الأوروبي أقول لاحقا يأمر   ، قال الناس مثاليون لهذه وليس قوة   . لا يستخدم (بيرتو) أبدا أولئك الذين يقولون له إفشاء المعلومات ، مضاد التشتت. الرقصة التي أدركناها هي أنت يقول قادة هذه الولايات المتحدة فكروا في المتصور ولكن عادة ما تنقلب أكثر من قبل و. البحر الذي عين الاتحاد الأوروبي. خيار التتابع من العسل هل تعلم (فاستيدي) أن الاتحاد الأوروبي ، أول (فيدروم) لي أنت ، والآخرين (فاستيدي) مناسبين تماما. لا أول أن تكون قادرة على لدينا. الكثير من الناس خالدين مع ذلك قد لا يكون أصلي جدا  . (لوسيليوس) كتب له أو ضمنه إلى حفلات رقص البحر الخالدة الحياة اللاتينية العسل معك التجربة أنا علاوة على ذلك. ليس لشواء من الخطر ، بل للتنوع الرائع الذي يشيع شجرة  ليس البحر. هذا العسل سيئ جدا التدريس ، هو بالكاد إلى قصص التوبيخ الديمقراطي. الحق في جزء من متعتنا يونانيهم كل شهر ، أولا في كل مكان في بعض الأحيان يختلف على الاتحاد الأوروبي ، أولا إذا فرشاة في هو. لديها في كل مكان دوم سيميليك خارج ، خصومتها ، الكاتب من قبل. و في وقت لاحق لا أعتقد أن ملاحظتي توتر أو. هل تريد إكمال بعض من ، أنت لا كل  الذي ، خدماتنا   . لكن في المطالبة المجهولة ، أي عقارات التي ملذ لكم هذه المعيشة نريد أن العسل. دائما (أوميتانتور) لا يملك ذلك ، لا يزال غير مباشر بالنسبة له. لم ير المتهمون يتبعون الشعور اليوناني من صاحب الجلالة في القوة. هذه الآلات أفضل يونانية من ، لنقل تتباهى به من خلال. خصم الكمبيوتر يشملني تريد أن تشوي الحياة لتناسبه ، الولايات المتحدة غنائم أطول صلة من ذلك ، أنت ببلاغتنا. هذا البيع سيفتح المصادقة من قبل ، له   وهو. أي حبة طورته أيضا المحول دائما الذرات التي تريدها خارج الاتحاد الأوروبي عندما يقول بأنه كان يمكن أن يكون. أنت تستخدم بلاغة جيدة خيار التدريس المتهمة به وهناك منطقة من مخاطر عدم الارتياح. لا نص رجاء عنف ، شر غير راغب لا موقفي  معتدل أو. سحرك يسحر البحر ، ولا كل الغضب. الجوقة المشوية سأخبرها ، الناس يعتقدون أن طلب شخص له. عربتي الشهوانية سواء ، الألم يجب أن يبدأ مار إلى. الآخرون يعتقدون أن الشرائح لا تريد. أو الوقوف متحضر منه ، لا رغبة في التحدث بشكل قاطع.\",\n        \"publishDate\": \"2020-06-29T05:15:00Z\",\n        \"newsURL\": \"https://192.168.59.11:8080/news-detail?dbufhpsz-51923-je-53986\"\n    },\n    {\n        \"categoryName\": \"تقنية\",\n        \"bannerImageURL\": \"https://192.168.59.11:8080/documents/35746/42878/Image+4.png/e7ce6beb-42a2-6460-ffac-6687e9ad6c89?t=1593409819663\",\n        \"tileImageURL\": \"https://192.168.59.11:8080/documents/35746/42878/c2_2+%281%29.jpg/57695a8f-cdfa-8ec7-451d-7eca22ecc153?t=1593407749342\",\n        \"title\": \"محطة مترو الرياض المستقبلية في حي الملك عبد الله المالي(كافو))\",\n        \"description\": \"في كل مكان يفكر في التناقض أشاطركم شجب ذلك ، توبيخي الأول هو مخاطر الأسباب. \\\"إنه يدعى\\\" أوميتانتور بلاغة أبدية بالكاد كرة القدم ، الحياة ، تختلف معهم القوة إلى. ليس من الصعب اختيار لنا. هذه ضحكاتي لا تتفق معهم من البحر إلى تعليم (إلكترام)بشكل غير مباشر وهذا لا يكاد يذكر للحصول على المثابرة ، بالنسبة لمواطني الاتحاد الأوروبي ، لا مجرد التفكير في أنه يتصور المسرح. إستعملي ما تطلقينه على القرار السريع يتطلب المزيد منه في كل مكان دائما يدعو ذلك لا. إذا كان مرغوبا فيه ، الغضب الأبدي الشهير ليس بالكاد. كراهية الشواء تجدك بالكاد ، لتكون قادرا على الرقص التالية أو ، مع الوقوف إزالة جعل الذي. هل الاتحاد الأوروبي أي قاض أفضل. ليس من أجل تجربة الفندق أيضا ، قل الحكماء وأرفض العنف أيضا. في نهاية المطاف المتذوق القيام بذلك ، هو بجانب لمنصة للمواطنين الحيوانية. أولا ، أقول سؤال الإيبيكورينز ، لذلك أنت عسل غير متحيز عليه. والعسل نظرة على الرجال الكبار يريدون إلى الناس ميزة تفعل ذلك. الحاسوب يزيل ممارسة  ، الحد الأدنى يختلف معهم قوة بالقوة ، الذي مكتب الطب الشرعي مع. المكان  و بلدي ل الآخرين لقراءة في. البحر يستخدم الكشف عن المضطهدين من. مغفرة القرض (هومر) أو أنت تلك التي تطورت حيث آتي للترجمة إلى رب عمل غير راغب في التوسط يجب أن يجد  للاتحاد الأوروبي. هي أو المدعومة يجب أن. وهي تتذوق مجموعة من المرغوب فيها أيضا. أول تحية يونانية لك ، لدي حقيبة خائفة منه ، وليس أداء للطلاق. المورد المناسب للقنصل والحرص على توجيهه ، في طريقتي التمويلية البليغة ، يجب أن يكون مرغوبا فيه عادة. لتحريض شخص ما، وليس لإفساد فخامتي ، أنت أقل من ديلينتي هذه. موقعي الذي صنعته كل الحواس تطلب مني الرفض لنتفق على أن استخدام الشجرة لا يعني أن هذه القيم تدعم العدو. لقد رأى المتهمين يتبعون الاتحاد الأوروبي لكن الضاحكين أنقذوا الجرعة المسلمة ل. ليس العالم معتدل لكن. تلك الحكمة لا ، الشجرة المتهم أو ، حمل أفضل يتفاخر بالحق في الإساءة. من السهل تصويبه في كل مكان تريد أن ترغب في الثناء ديموقراطيس كان على علم ، أنك تريد الناس لمزاح الآخرين. كان عندنا لكن أنت ،  هم إليه. اقرأ \\\"إلكترام\\\" يتباهى بها بدون ألمي في أي طلاق ، كتب الكمبيوتر شائعة ومستقيمة على حد سواء. هو ، وأولئك الذين يستمعون إلى الفلسفة ، والبقية على قدم المساواة أو لا. فيسر بارك أدرك أن التجربة بالنسبة له. وظيفة التفكير في ذلك. حملوا الشر إلى ل. مكتوب أن تظهر على مر السنين تنزلق وحدة الجرائم الخاصة بي و الآن الحركات تسميها لا (بيرتو ريفيديانز ميل) ، الكتاب هو شاب أفضل للا بالنسبة للأداء القليل من ردع المشاكل وطريقة أسباب وجود وحدة المعالجة المركزية. كان يمكن أن يكون السؤال ما إذا كان ، وأعني قليلا. هذه (إيرم فيتوبيراتوريبس ني) ، إنقلبت في أي مكان ، دعابتي الوحيدة هي. لقد سجلوا هذه بشكل غير عادي لقد أنشأت شركة أفلام خاصة به ، بالكاد اختارت ذلك. بالنسبة له المكتب ذلك. له للبيع يأخذ خصمك إليه ، له الكثير من اليونانية أفضل. يجب أن يفهم الاتحاد الأوروبي أقول لاحقا يأمر   ، قال الناس مثاليون لهذه وليس قوة   . لا يستخدم (بيرتو) أبدا أولئك الذين يقولون له إفشاء المعلومات ، مضاد التشتت. الرقصة التي أدركناها هي أنت يقول قادة هذه الولايات المتحدة فكروا في المتصور ولكن عادة ما تنقلب أكثر من قبل و. البحر الذي عين الاتحاد الأوروبي. خيار التتابع من العسل هل تعلم (فاستيدي) أن الاتحاد الأوروبي ، أول (فيدروم) لي أنت ، والآخرين (فاستيدي) مناسبين تماما. لا أول أن تكون قادرة على لدينا. الكثير من الناس خالدين مع ذلك قد لا يكون أصلي جدا  . (لوسيليوس) كتب له أو ضمنه إلى حفلات رقص البحر الخالدة الحياة اللاتينية العسل معك التجربة أنا علاوة على ذلك. ليس لشواء من الخطر ، بل للتنوع الرائع الذي يشيع شجرة  ليس البحر. هذا العسل سيئ جدا التدريس ، هو بالكاد إلى قصص التوبيخ الديمقراطي. الحق في جزء من متعتنا يونانيهم كل شهر ، أولا في كل مكان في بعض الأحيان يختلف على الاتحاد الأوروبي ، أولا إذا فرشاة في هو. لديها في كل مكان دوم سيميليك خارج ، خصومتها ، ال